import './index.css';

const Title = (props) => (
    <ul>
        {
            props.its.map((item,idx)=>(
                    <li onClick={()=>props.delItem(idx)} key={`listItem${index}`}> {item} </li>
                )
            )
        }
    </ul>

)
export default Title;
